function incHandler() {
  return {
    type: "INC",
  };
}
function decHandler() {
  return {
    type: "DEC",
  };
}
function textHandler(e) {
  return {
    type: "TEXT",
    payload: e,
  };
}
export { incHandler, decHandler, textHandler };
